INSERT INTO `film` (`film_ID`, `film_Name`, `film_Director`, `film_Cast`, `film_Genre`, `film_Running_time`, `film_Release_date`, `film_Description`, `film_Language`, `film_Rated`, `film_photo`, `film_trailer`, `film_Slider`) VALUES
('film01', 'VÂY HÃM: KẺ TRỪNG PHẠT', 'Heo Myeong Haeng', 'Ma Dong-seok, Kim Mu-yeol, Lee Joo-bin', 'Hành Động', '125 phút', '2024-04-26', 'Siêu cớm Ma Seok-do tái xuất để đối đầu với những tội phạm tinh vi trong giới công nghệ. Nắm đấm trứ danh liệu có phát huy được sức mạnh trước liên minh tội phạm của thiên tài công nghệ và ông trùm nhà cái lớn nhất châu Á?', 'Phụ đề Tiếng Việt và Tiếng Anh', 'T18: Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'vayham.jpg', 'VayHam_Trailer.mp4', 'vayham_s.jpg'),
('film02', 'GODZILLA X KONG: ĐẾ CHẾ MỚI 2D (K)', 'Adam Wingard', 'Rebecca Hall, Dan Stevens, Rachel House', 'Khoa Học Viễn Tưởng', '125 phút', '2024-03-27', 'Kong và Godzilla - hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.', 'Phụ đề Tiếng Việt và Tiếng Anh', 'Phim dành cho khán giả từ dưới 13 tuổi với điều kiện xem cùng cha, mẹ hoặc người giám hộ.', 'godzilla-x-kong.jpg', 'Godzilla.mp4', 'god_s.jpg'),
('film03', 'LẬT MẶT 7: MỘT ĐIỀU ƯỚC (K)', 'Lý Hải', 'Thanh Hiền, Trương Minh Cường, Đinh Y Nhung, Quách Ngọc Tuyên, Trâm Anh, Trần Kim Hải', 'Tình Cảm, Phim Hài', '138 phút', '2024-04-20', 'Một câu chuyện lần đầu được kể bằng tất cả tình yêu, và từ tất cả những hồi ức xao xuyến nhất của đấng sinh thành.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ dưới 13 tuổi với điều kiện xem cùng cha, mẹ hoặc người giám hộ.', 'latmat7.jpg', 'latmat7.mp4', 'latmat7_s.webp'),
('film04', 'TU VIỆN MÁU (T18)', 'Michael Mohan', 'Sydney Sweeney, Álvaro Morte, Simona Tabasco', 'Kinh Dị', '85 phút', '2024-04-19', 'Với đức tin sâu sắc, Cecilia đến với một tu viện cổ kính, nằm giữa một vùng quê đẹp nên thơ tại nước Ý trong sự chào đón của mọi người. Thế nhưng, những sự kiện kỳ lạ liên tiếp xảy ra, một bước ngoặt đưa Cecilia đến một vị trí cô không thể ngờ tới. Cùng với đó, những bí mật kinh hoàng đằng sau vẻ bình yên của tu viện này dần lộ diện.', 'Phụ đề Tiếng Việt và Tiếng Anh', ' Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'tuvien.webp', 'tuvien.mp4', 'tuvien_s.webp'),
('film05', 'ĐIỀM BÁO CỦA QUỶ (T18)', 'Arkasha Stevenson', 'Nell Tiger Free, Tawfeek Barhom, Sonia Braga, Ralph Ineson, and Bill Nighy', 'Kinh Dị', '135 phút', '2024-04-04', 'Khi một cô gái người Mỹ được đưa đến Rome để bắt đầu phụng sự Giáo Hội, cô đã phát hiện ra thế lực hắc ám khiến cô hoài nghi về đức tin của chính mình, đồng thời hé lộ một âm mưu kinh hoàng nhằm tái sinh linh hồn ác quỷ đầu thai đến nhân thế.', 'Phụ đề Tiếng Việt và Tiếng Anh', 'Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'diembao.jpg', 'diembao.mp4', 'diembao_s.png'),
('film06', 'NGƯỜI \"BẠN\" TRONG TƯỞNG TƯỢNG (T13)', 'Jeff Wadlow', 'DeWanda Wise, Tom Payne, Taegan Burns, Pyper Braun, Veronica Falcon, Betty Buckley', 'Kinh Dị', '115 phút', '2024-04-12', 'Khi Jessica (DeWanda Wise) chuyển về ngôi nhà thời thơ ấu cùng gia đình thì cô con gái riêng bé bỏng Alice (Pyper Braun) vô tình tìm thấy một chú gấu nhồi bông tên là Chauncey ở tầng hầm. Cô bắt đầu chơi những trò chơi cùng với Chauncey, thoạt đầu các trò chơi đều rất vui tươi, thú vị nhưng càng về sau, các trò chơi dần trở nên nguy hiểm hơn. Khi những hành động của Alice trở nên kì lạ, Jessica nhận ra Chauncey không chỉ là một chú gấu nhồi bông vô hại bình thường mà nó đã mang đến rất nhiều nỗi', 'Phụ đề Tiếng Việt và Tiếng Anh', 'Phim dành cho khán giả từ đủ 13 tuổi trở lên.', 'firend.webp', 'friend.mp4', 'friend_s.jpg'),
('film07', 'CÁI GIÁ CỦA HẠNH PHÚC (T18)', 'Nguyễn Ngọc Lâm', 'Thái Hòa, Xuân Lan, Lâm Thanh Nhã, Uyển Ân', 'Tình Cảm, Tâm Lý', '130 phút', '2024-04-18', 'Bà Dương và ông Thoại luôn cố gắng để xây dựng một hình ảnh gia đình tài giỏi và danh giá trong mắt mọi người. Tuy nhiên dưới lớp vỏ bọc hào nhoáng ấy là những biến cố và lục đục gia đình đầy sóng gió. Nhìn kĩ hơn một chút bức tranh gia đình hạnh phúc ấy, rất nhiều “khuyết điểm” sẽ lộ ra gây bất ngờ.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'hanhphuc.jpg', 'hanhphuc.mp4', 'hanhphuc_s.jpg'),
('film08', 'B4S - TRƯỚC GIỜ \"YÊU\" (T18)', 'Tùng Leo, Michael Thái, Huỳnh Anh Duy', 'Jun Vũ, Khánh Vân, Khazsak, Tôn Kinh Lâm, Tùng, Việt Hưng, Vinh Râu', 'Tình Cảm, Phim Hài, Tâm Lý', '110 phút', '2024-04-19', 'B4S - Trước Giờ \"Yêu\" sẽ bắt đầu bằng một đêm \"nhớ đời\" của hai nhóm bạn thân tại quán bar. Và sau đó, khán giả sẽ được theo dõi câu chuyện tình yêu của từng người trong \"đêm định mệnh\" ấy.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'yeu.webp', 'yeu.mp4', 'yeu_S.jpg'),
('film09', '2D P KID PANDA ĐẠI NÁO LÃNH ĐỊA VUA SƯ TỬ (P)', 'Victor Garcia', 'Anime', 'Hoạt Hình', '88 phút', '2024-05-03', 'Để giải cứu rồng con Tiểu Long đang bị bắt cóc sang châu Phi, Gấu trúc Bư quyết định ra đi tìm đường cứu bạn. Trên hành trình của mình, Bư đã khám phá ra một thế giới hoàn toàn xa lạ và phải đối mặt với những con hà mã đáng sợ, những con linh cẩu khôn ngoan và những con khỉ đột chiêu trò. Dựa vào trí thông minh của mình, Bư đã tìm đường băng xuyên châu Phi trước khi giải cứu Tiểu Long và cứu ngôi nhà trong rừng rậm của những người bạn mới trước âm mưu tàn ác của sư tử Malume.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả mọi lứa tuổi.', 'kungfu.jpg', 'kungfu.mp4', 'kungfu_s.jpg'),
('film10', 'ARTHUR: CHÚ CHÓ KIÊN CƯỜNG', 'Simon Cellan Jones', 'Mark Wahlberg, Simu Liu, Nathalie Emmanuel', 'Tình Cảm, Tâm Lý', '99 phút', '2024-05-03', 'Giữa chặng đua đầy khắc nghiệt kéo dài 5 ngày, đội đua của Michael cùng các đồng đội đã nhận được sự giúp đỡ của chú chó hoang Arthur. Một team hoàn chỉnh được thành lập và tạo nên một chặng đua truyền cảm hứng nhất từ trước tới giờ.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 13 tuổi trở lên.', 'cho.jpg', 'cho.mp4', 'cho_s.jpg'),
('film11', 'TAROT', 'Spenser Cohen, Anna Halberg', 'Avantika, Jacob Batalon, Olwen Fouéré', 'Kinh Dị', '99 phút', '2024-05-10', 'Bạn sẽ nhìn thấy ai khi trút hơi thở cuối cùng?\r\n\r\n', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 16 tuổi trở lên.', 'tarot.jpg', 'tarot.mp4', 'tarot_s.jpg'),
('film12', 'NOBITA VÀ BẢN GIAO HƯỞNG ĐỊA CẦU', 'Kazuaki Imai', 'Wasabi Mizuta, Megumi Ôhara, Yumi Kakazu', 'Hoạt Hình', '99 phút', '2024-05-24', 'Sẽ thế nào nếu thế giới không còn âm nhạc? Mùa hè này, hãy cùng Doraemon và những người bạn bắt đầu cuộc phiêu lưu ngập tràn giai điệu nhé!', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả mọi lứa tuổi.', 'nobita.webp', 'nobita.mp4', 'nobita_s.jpg'),
('film13', 'THẦN BÀI TRỞ LẠI TẤT TAY (T18)', 'Matt Lai', 'Khương Hạo Văn, Lâm Đức Tài, Hoàng Minh Chí,…', 'Phim Hài', '102 phút', '2024-04-19', 'Mang danh thần bài trăm trận trăm thắng, Trình Gia Lãng phát hoảng khi siêu năng lực mắt thần đột nhiên mất vào tay một kẻ gà mờ - Hoàng Tiểu Thất. Từ đây, cả hai phải miễn cưỡng hợp lực hòng chiến thắng vua bài - Vi Nhất Phú và làm lộ ra bí mật động trời...', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 18 tuổi trở lên.', 'thanbai.jpg', 'thanbai.mp4', 'thanbai_s.jpg'),
('film14', 'NGÔI ĐỀN KỲ QUÁI 4 (T16)', 'Phontharis Chotkijsadarsopon', 'Witthawat Rattanaboonbaramee, Bhuripat Vejvongsatechawat, Phiravich Attachitsataporn', 'Phim Hài, Kinh Dị', '125 phút', '2024-05-31', 'Hồn ma Nak với sức mạnh khủng khiếp nhất, đáng sợ nhất mà bộ đôi mỏ hỗn Balloon & First phải đối mặt để giải cứu cho trai đẹp Min Joon. Liệu hội bạn này sẽ giải được nghiệp mình tạo ra hay sẽ tan rã từ đây?', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 16 tuổi trở lên.', 'ngoiden.webp', 'ngoiden.mp4', 'ngoiden_s.jpg'),
('film15', 'GARFIELD - MÈO BÉO SIÊU QUẬY', 'Mark Dindal', 'Hannah Waddingham, Chris Pratt, Samuel L. Jackson', 'Hoạt Hình, Phim Hài', '99 phút', '2024-05-24', 'Mèo vàng Garfield siêu quậy quay trở lại trong bộ phim mới nhất Garfield Movie. Đón xem ngay vào dịp hè năm 2024 nhé!\r\n\r\n', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả mọi lứa tuổi.', 'meo.webp', 'meo.mp4', 'meo_s.jpg'),
('film16', 'JOKER: ĐIÊN CÓ ĐÔI', 'Todd Phillips', 'Joaquin Phoenix, Lady Gaga, Zazie Beetz', 'Tâm Lý', '99 phút', '2024-10-04', 'Joker: Folie à Deux là phần nối tiếp câu chuyện về Arthur Fleck khi tạo ra một cuộc bạo loạn chưa từng có tại Gotham. Đặc biệt, Lady Gaga sẽ vào vai Harley Quinn, người tình nổi tiếng nhưng cũng không kém phần điên loạn của gã hề Joker.', 'Phụ đề Tiếng Việt', ' Phim dành cho khán giả từ đủ 16 tuổi trở lên.', 'joker.webp', 'joker.mp4', 'joker_s.jpg'),
('film17', 'HÀNH TINH KHỈ', 'Wes Ball', 'Kevin Durand, Freya Allan, Owen Teague', 'Khoa Học Viễn Tưởng', '99 phút', '2024-05-10', 'Kingdom Of The Planet Of The Apes lấy bối cảnh nhiều năm sau triều đại của Proximus Ceasar trong War for the Planet of The Apes (2017). Khỉ trở thành giống loài thống trị thế giới, còn con người phải khép mình trong bóng tối. Triều đại độc tài mới được thiết lập. Noa – một chú khỉ trẻ đặt ra những câu hỏi về quá khứ của hành tinh khỉ và dấn thân vào hành trình chống lại đế chế mới.', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 13 tuổi trở lên.', 'khi.webp', 'khi.mp4', 'khi_s.jpg'),
('film18', 'NHỮNG NGƯỜI BẠN TƯỞNG TƯỢNG', 'John Krasinski', 'Ryan Reynolds, Cailey Fleming, John Krasinski', 'Phim Hài', '99 phút', '2024-05-17', 'Bộ phim xoay quanh một cô bé bất ngờ phát hiện ra mình có thể nhìn thấy những người bạn tưởng tượng của mọi người. Và cuộc hành trình bắt đầu khi cô bé sử dụng siêu năng lực của mình để giúp đỡ những người bạn tưởng tượng này tránh khỏi việc bị bỏ rơi và lãng quên bằng cách tìm kiếm, kết nối chúng với những đứa trẻ.\r\n\r\n', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 13 tuổi trở lên.', 'friend.jpg', 'friend.mp4', 'friend_s.webp'),
('film19', 'THANH XUÂN 18X2: LỮ TRÌNH HƯỚNG VỀ EM (T13)', 'Michihito Fujii', 'Hứa Quang Hán, Kiyohara Kaya, Trương Chấn', 'Tình Cảm', '135 phút', '2024-04-03', 'Ký ức tình đầu ùa về khi Jimmy nhận được tấm bưu thiếp từ Ami. Cậu quyết định một mình bước lên chuyến tàu đến Nhật Bản gặp lại người con gái cậu đã bỏ lỡ 18 năm trước. Mối tình day dứt thời thanh xuân, liệu sẽ có một kết cục nào tốt đẹp khi đoàn tụ?', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 13 tuổi trở lên.', 'thanhxuan.webp', 'thanhxuan.mp4', 'thanhxuan_S.jpg'),
('film20', 'ANH HÙNG BÀN PHÍM (T16)', 'Ahn Guk Jin', 'Son Sukku, Kim Sung-Cheol, Kim Dong-Hwi, Hong Kyung', 'Hành Động', '120 phút', '2024-04-19', 'Im Sang-jin - một phóng viên mảng xã hội đã bị đình chỉ công tác sau bài phóng sự điều tra sai lệch về những lùm xùm của tập đoàn Manjun. Tưởng rằng phải chịu nỗi oan ức suốt đời, Im Sang-jin bất ngờ nhận được thông tin ẩn danh khẳng định anh không sai, mà mọi thứ đã bị thao túng bởi một “đội quân” trực tuyến: Chỉ cần có tiền, sự thật nào cũng hoá thành dối lừa, còn tin tức giả lại hoá thành sự thật. Quyết tâm dấn thân vào con đường điều tra “Team Aleph”, Im Sang-jin dần khám phá ra những bí mật', 'Phụ đề Tiếng Việt', 'Phim dành cho khán giả từ đủ 16 tuổi trở lên.', 'anhhung.webp', 'anhhung.mp4', 'anhhung_x.jpg');
